def winner_of_game(A):
    n = len(A)
    dp = [[0] * n for _ in range(n)]

    for i in range(n):
        dp[i][i] = 1

    for length in range(2, n+1):
        for i in range(n-length+1):
            j = i + length - 1
            if A[i] < A[j]:
                dp[i][j] = not dp[i+1][j] or not dp[i][j-1]
            else:
                dp[i][j] = not dp[i][j-1] and not dp[i+1][j]

    return "Alice" if dp[0][n-1] else "Bob"
